    render() { 
        const {task}=this.props  
      return (
        <>
        <div className="todo_style">
        <span >
            <DeleteIcon className="deleteIcon" />
        </span>
        <li style={ {textDecoration : 'line-through' } } >
        {this.props}
      </li>
      </div>
       </>
    )
    }
}
export default List;
